import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'proyectoF';
}
<a routerLink="/mostrarDiscipline" class="btn btn-primary", style="margin-bottom: 10px;">Cambios a Disciplina</a>
<a routerLink="/mostrarCompetitor" class="btn btn-primary" style="margin-bottom: 10px;">Cambios a Competidor</a>
<a routerLink="/mostrarEvent" class="btn btn-primary" style="margin-bottom: 10px;">Cambios a Evento</a>
<a routerLink="/mostrarStake" class="btn btn-primary" style="margin-bottom: 10px;">Cambios a Participacion</a>

<router-outlet></router-outlet>
